import React, { Component } from "react";
import "./bloodbank.css";

class BloodbankA extends Component {
  render() {
    return (
        <div>
                    <h6>FFP 0 Rh P(0+): {this.props.ffp_0pos}</h6>
        <h6>FFP A Rh P(A+): {this.props.ffp_Apos}</h6>
        <h6>FFP B Rh P(B+): {this.props.ffp_Bpos}</h6>
        <h6 class="a">FFP AB Rh P(AB+): {this.props.ffp_ABpos}</h6>

        </div>

    );
  }
}

export default BloodbankA;
